ファッションとして人気のある美しいペイズリー柄をプリントしたiPod touch クリア ケース。<br><br><table border="0" cellpadding="2" cellspacing="0" width="400"><tbody> <tr>
      <td bgcolor="#cccccc">　商品特長</td>
    </tr>
    <tr>
      <td><br>
      <font size="2">Plus-s(プラスエス)シリーズは、ポリカーボネイト製カバーをベースに、高品質UV硬化型インクにてプリント！商品加工すべてを日本国内の熟練した職人の手作業で行われます。made in japan<br>
      <br>
      しっかりと装着出来、端末を傷から守る事ができる機能性にも優れたケースです。ハードケース素材で、UV硬化型インクにて高品質プリントを施すことにより、高級感ある仕上がりとなっております。<BR>
      <BR>
      ジャケットを装着したままで、イヤホンや充電コネクターの接続、タッチパネルの使用など操作性も確保しております。 <BR>
      <br>
      </font></td>
    </tr>
    <tr>
      <td align="center">&nbsp;<img src="http://image.rakuten.co.jp/kintsu/cabinet/plus-s/explanation_plus-s.jpg" /><br>
      <br>
      </td>
    </tr>
    <tr><td align="left" bgcolor="cccccc">　商品説明</td></tr><tr><td align="left"><br><font size="2" color="#404040">・スマートフォンケース側面への印刷は入りません。<br>
      ・装着したまま充電可能（卓上ホルダには対応しません）です。<br>
      ・ベースのスマートフォンケースは、複数の仕入れ先より入手しており、入荷時期によって形状が若干変わる事があります。<br>
      </font>
      <hr>
      <font size="2" color="#404040">素材：ケース本体／ポリカーボネート(クリアケース)<br>
      加工：UV硬化型インク（側面にプリントは入りません）<br>
      対応機種・サイズ：iPod touch専用<br>
      </font>
      <hr>
      <font size="2" color="#404040">※機種本体は含まれておりません。<br>
      ※仕様は予告なく変更する場合がございます。</font></td></tr></tbody></table><style type="text/css">
span.unit {
